        <nav className='navbar navbar-light bg-light'>
          <a className='navbar-brand' href=''>
            Todo App
          </a>
        </nav>
        <TodoForm />
        <div className='mt-5'>
          <ul className='list-group'>
            <li className='list-group-item'>Buy Milk</li>
            <li className='list-group-item'>Download some library</li>
          </ul>
        </div>
      </div>
  );
}

export default App;
